%[text] # Filtros
%%
%[text] ## Importar
%[text] ![](text:image:276c)
%[text] Desde osciloscopio Rigol
%Se침ales del generador
wave_sqr = readmatrix("data/cuadrada.CSV"); %mV
wave_sin = readmatrix("data/senoidal.CSV"); %mV
N = length(wave_sin);
fs = 1/2E-06 %Hz; %[output:7b3c66bf]

%Se침ales con ruido
noise_sqr = readmatrix("data/DS0011.CSV");
noise_sin = readmatrix("data/DS0010.CSV");
fs_noise = 1/1.000E-04 %Hz %[output:3865e887]
N_noise = length(noise_sin) %[output:0bccdca1]

%[text] ![](text:image:5ac6)
%[text] Desde la grabaci칩n de audio
%Demen un audio porfa

%audio_sqr = audioread()
%audio_sin = audioread()
%[text] Se침al del filtro resonante
%[text] ![](text:image:9730)
res_filter = readmatrix("data/scope_csv_27_0.csv");
N_res = length(res_filter);
fs_res = 1/res_filter(1,1);
res_filter = res_filter(:,2);
%%
%[text] ## Visualizar en tiempo
figure %[output:00af5c06]
plot(wave_sin) %[output:00af5c06]
hold on %[output:00af5c06]
plot(wave_sqr) %[output:00af5c06]
hold off %[output:00af5c06]

figure %[output:2c19965a]
plot(res_filter) %[output:2c19965a]

figure %[output:8850268a]
plot(noise_sqr) %[output:8850268a]

figure %[output:985aaf6e]
plot(noise_sin) %[output:985aaf6e]
%[text] Escuchar 
%[text] ![](text:image:896d)
%
%%
%[text] ## Espectro
%[text] ![](text:image:1839)
periodogram([wave_sin wave_sqr],flattopwin(N),N,fs) %[output:31c318e3]
periodogram(res_filter,flattopwin(N_res),N_res,fs_res) %[output:6f195a26]
periodogram([noise_sqr noise_sin],flattopwin(N_noise),N_noise,fs_noise) %[output:2617b326]

